- (id)copyWithZone:(NSZone *)zone
{
    GEORPCorrectedSearch *copy = [[[self class] allocWithZone:zone] init];
    os_unfair_lock_lock_with_options(&_readerLock, OS_UNFAIR_LOCK_DATA_SYNCHRONIZATION);
    PBDataReader *reader = _reader;
    os_unfair_lock_unlock(&_readerLock);
    @synchronized(reader) {
        if (reader) {
            BOOL wroteAny = NO
                || _flags.wrote_placeSearchRequest
                || _flags.wrote_placeSearchResponse
                || _flags.wrote_originalSearchResultIndex
                || _flags.wrote_correctedSearchResultIndex
                || _flags.wrote_preferredSearchDisplayLocation
                || _flags.wrote_placeRequest
                || _flags.wrote_placeResponse
            ;
            if (!wroteAny) {
                reader->_length = (NSUInteger)_readerMarkLength;
                [reader seekToOffset:(NSUInteger)_readerMarkPos];
                GEORPCorrectedSearchReadAllFrom(copy, reader, NO);
                return copy;
            }
            [self readAll:NO];
        }
    }
    copy->_placeSearchRequest = [_placeSearchRequest copyWithZone:zone];
    copy->_placeSearchResponse = [_placeSearchResponse copyWithZone:zone];
    if (self->_flags.has_originalSearchResultIndex)
    {
        copy->_originalSearchResultIndex = _originalSearchResultIndex;
        copy->_flags.has_originalSearchResultIndex = YES;
    }
    if (self->_flags.has_correctedSearchResultIndex)
    {
        copy->_correctedSearchResultIndex = _correctedSearchResultIndex;
        copy->_flags.has_correctedSearchResultIndex = YES;
    }
    copy->_preferredSearchDisplayLocation = [_preferredSearchDisplayLocation copyWithZone:zone];
    copy->_placeRequest = [_placeRequest copyWithZone:zone];
    copy->_placeResponse = [_placeResponse copyWithZone:zone];
    return copy;
}


- (BOOL)isEqual:(id)object
{
    GEORPCorrectedSearch *other = (GEORPCorrectedSearch *)object;
    if (![other isMemberOfClass:[self class]]) {
        return NO;
    }
    [self readAll:YES];
    [other readAll:YES];


    return YES
    &&
    ((!self->_placeSearchRequest && !other->_placeSearchRequest) || [self->_placeSearchRequest isEqual:other->_placeSearchRequest])
    &&
    ((!self->_placeSearchResponse && !other->_placeSearchResponse) || [self->_placeSearchResponse isEqual:other->_placeSearchResponse])
    &&
    ((self->_flags.has_originalSearchResultIndex && other->_flags.has_originalSearchResultIndex && self->_originalSearchResultIndex == other->_originalSearchResultIndex) || (!self->_flags.has_originalSearchResultIndex && !other->_flags.has_originalSearchResultIndex))
    &&
    ((self->_flags.has_correctedSearchResultIndex && other->_flags.has_correctedSearchResultIndex && self->_correctedSearchResultIndex == other->_correctedSearchResultIndex) || (!self->_flags.has_correctedSearchResultIndex && !other->_flags.has_correctedSearchResultIndex))
    &&
    ((!self->_preferredSearchDisplayLocation && !other->_preferredSearchDisplayLocation) || [self->_preferredSearchDisplayLocation isEqual:other->_preferredSearchDisplayLocation])
    &&
    ((!self->_placeRequest && !other->_placeRequest) || [self->_placeRequest isEqual:other->_placeRequest])
    &&
    ((!self->_placeResponse && !other->_placeResponse) || [self->_placeResponse isEqual:other->_placeResponse])
    ;
}

