- (void)mergeFrom:(GEORPCorrectedSearch *)other
{
    [other readAll:NO];
    if (self->_placeSearchRequest && other->_placeSearchRequest)
    {
        [self->_placeSearchRequest mergeFrom:other->_placeSearchRequest];
    }
    else if (!self->_placeSearchRequest && other->_placeSearchRequest)
    {
        [self setPlaceSearchRequest:other->_placeSearchRequest];
    }
    if (self->_placeSearchResponse && other->_placeSearchResponse)
    {
        [self->_placeSearchResponse mergeFrom:other->_placeSearchResponse];
    }
    else if (!self->_placeSearchResponse && other->_placeSearchResponse)
    {
        [self setPlaceSearchResponse:other->_placeSearchResponse];
    }
    if (other->_flags.has_originalSearchResultIndex)
    {
        self->_originalSearchResultIndex = other->_originalSearchResultIndex;
        self->_flags.has_originalSearchResultIndex = 1;
    }
    if (other->_flags.has_correctedSearchResultIndex)
    {
        self->_correctedSearchResultIndex = other->_correctedSearchResultIndex;
        self->_flags.has_correctedSearchResultIndex = 1;
    }
    if (other->_preferredSearchDisplayLocation)
